	@test integrate(sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x))*(f + g*x)^2, x) == :(-((2*b*f*g*x*sqrt(d + c^2*d*x^2))/(3*c*sqrt(1 + c^2*x^2))) - (b*c*f^2*x^2*sqrt(d + c^2*d*x^2))/(4*sqrt(1 + c^2*x^2)) - (b*g^2*x^2*sqrt(d + c^2*d*x^2))/(16*c*sqrt(1 + c^2*x^2)) - (2*b*c*f*g*x^3*sqrt(d + c^2*d*x^2))/(9*sqrt(1 + c^2*x^2)) - (b*c*g^2*x^4*sqrt(d + c^2*d*x^2))/(16*sqrt(1 + c^2*x^2)) + (1/2)*f^2*x*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)) + (g^2*x*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)))/(8*c^2) + (1/4)*g^2*x^3*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)) + (2*f*g*(1 + c^2*x^2)*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)))/(3*c^2) + (f^2*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x))^2)/(4*b*c*sqrt(1 + c^2*x^2)) - (g^2*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x))^2)/(16*b*c^3*sqrt(1 + c^2*x^2)))
	@test integrate(sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x))*(f + g*x)^1, x) == :(-((b*g*x*sqrt(d + c^2*d*x^2))/(3*c*sqrt(1 + c^2*x^2))) - (b*c*f*x^2*sqrt(d + c^2*d*x^2))/(4*sqrt(1 + c^2*x^2)) - (b*c*g*x^3*sqrt(d + c^2*d*x^2))/(9*sqrt(1 + c^2*x^2)) + (1/2)*f*x*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)) + (g*(1 + c^2*x^2)*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x)))/(3*c^2) + (f*sqrt(d + c^2*d*x^2)*(a + b*asinh(c*x))^2)/(4*b*c*sqrt(1 + c^2*x^2)))
